request.description:
目前是全部輸出所有的星星類別

輸入

    {
        IsMotor : int   //是否為機車 0:否 1:是
    }

輸出

    {
        Result: string ,    //是否成功執行(1:成功;0:失敗)
        ErrorCode : string, //錯誤代碼(000000:SUCCESS;)
        NeedRelogin : int , //是否需重新登入(1:是;0:否)
        NeedUpgrade : int , //是否至商店更新app(1:是;0:否)
        ErrorMessage : string , //錯誤訊息，系統會依ErrorCode由TB中取出
        Data : {
            DescriptObj : [
                {
                    "Star": int,        //星星數
                    "Descript": int     //說明
                }
            ]
        }
    }

